import React from "react";
import Logo from "../../img/logo.png";





const LogoSearch = () => {
    return (
        <div className="ProfileSide">
            <div className="LogoSearch">
                <img src="{Logo}" alt="logo.png" />
            </div>
        </div>
    )
}
export default LogoSearch;
Logo.render()
